    "calhoun-and-batchtown-refuges-narrative-report-january-february-march-april-1952",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Calhoun National
    Wildlife Refuge and Batchtown National Wildlife Refuge outlines Refuge accomplishments
    from January through April of 1952. The report begins by summarizing the weather
    conditions, water conditions, and food and cover during this period. Wildlife including
    migratory birds, furbearers, raptors, and fish is also covered. The Refuge development
    and maintenance section discusses plantings. Resource management is outlined; topics
    include commercial fishing. The public relations section of the report describes
    recreational uses, fishing, and violations. NR forms are attached.",nt"license_title":
